import {Redirect, Link} from 'react-router-dom'
import "../App.css"
export default class navbar extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
          show : false
            
        }
       
    }
    
   
      
    
    
   
      logout = () => {
       
        localStorage.removeItem("token");
        
      };
      render () {
        
         
        
          return (
            <div className="nav-container">
            <nav className="navbar">
            <Link to="/acceuil" ><img className="logo"src={require('../Media/logo-falcon.png')}></img></Link>
          <span className="applybtn" ><Link to="/">{ this.props.show ?<button onClick={() => { !this.props.show
            this.logout()
                  }}>log out</button> : null}</Link></span> 
            </nav>   </div>
          );
        
    }}
